"use strict";(self.webpackChunkPortfolio=self.webpackChunkPortfolio||[]).push([[72],{1072:function(o){o.exports=JSON.parse('{"AboutH1":"O mě","IntroH2":"Ahoj, jmenuji se Martin Flasar!","IntroP":"Jsem vášnivý softwarový vývojář, který se věnuje vývoji elegantních a efektivních webových stránek. Díky zkušenostem v IT jsem si zdokonalil své dovednosti v různých programovacích jazycích a technologiích, abych mohl vytvářet smysluplné a uživatelsky přívětivé aplikace.","WorkflowH2":"Co dělám","WorkflowFrontendKD":"Specializuji se především na React.js a Vue.js, vytvářím pohlcující a dynamická uživatelská rozhraní.","WorkflowBackendKD":"I když se primárně zaměřuji na vývoj frontendu, mám také silné dovednosti ve vývoji backendu, zejména v Node.js. S Java Spring Boot a .NET frameworkem (ASP.NET CORE) mám také nějaké zkušenosti.","WorkflowFreelanceKD":"Mám minulost na volné noze, často pracuji na osobních nebo vedlejších projektech. Kromě toho jsem realizoval menší projekty pro klienty. Mé projekty na volné noze můžete prozkoumat na mé ","WorkflowFreelanceA":"vyhrazené stránce","JourneyH2":"Má cesta IT světem","JourneyP":"O programování jsem se začal zajímat na střední škole, kde jsem měl za úkol vyvinout jednoduchý program v Pascalu, od té chvíle moje zvědavost začala stoupat a klesat až do univerzitních dnů, kdy jsem se hlouběji ponořil do vývoje softwaru a vytvořil své první 3 středně velké projekty ( C++, PHP ) poté jsem se pomalu začal učit Web Development, kde jsem se cítil přitahován a našel radost z tvorby webových stránek. Od té doby jsem dělal různé projekty osobní nebo pro blízké klienty.","MotivationH2":"Vášnivý pro kódování a inovace","MotivationP":"Nesmírnou radost mám z kódování a práce v IT sektoru a zároveň využívám neomezených možností technologií k vývoji nových věcí pro vlastní potřebu nebo ku prospěchu klienta. Jsem oddán tomu, abych skrze softwarový vývoj přispíval k pozitivním změnám – ať už vytvářením webových stránek pro klienty, kteří budou spokojeni nebo optimalizací výkonu aplikací a jejich tvorbu."}')}}]);